{"source":{"uri":"features/catalogo.feature","data":"Feature: Catalogo de cafés\n    Como um usuário do site, eu quero ver o catálogo de cafés na página principal\n    Para que eu possa escolher e saber mais sobre os produtos disponíveis\n\n    Scenario: Acessar o catálogo de cafés na página principal\n\n        When acesso a página principal da Starbugs\n        Then eu devo ver uma lista de cafés disponíveis\n\n    Scenario: Iniciar a compra de um café\n\n        Given que estou na página principal da Starbugs\n            And que desejo comprar o seguinte produto:\n            | name     | Expresso Gelado |\n            | price    | R$ 9,99         |\n            | delivery | R$ 10,00        |\n        When inicio a compra deste item\n        Then devo ver a página de Checkout com os detalhes do produto\n            And o valor total da compra deve ser de \"R$ 19,99\"\n\n    Scenario: Café indisponível\n\n        Given que estou na página principal da Starbugs\n            And que desejo comprar o seguinte produto:\n            | name     | Expresso Cremoso |\n        When inicio a compra deste item\n        Then devo ver um popup informando que o produto está indisponível","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/cupom.feature","data":"Feature: Uso de Cupons no Checkout\n\n    Como um usuário da Starbugs, Eu quero poder aplicar cupons de desconto na página de checkout\n    Para que eu possa obter reduções no preço de produtos, aumentando a satisfação com a minha experiência de compra.\n\n    Background:\n        Given que iniciei a compra do item:\n            | name     | Café com Leite |\n            | price    | R$ 19,99       |\n            | delivery | R$ 10,00       |\n            | total    | R$ 29,99       |\n\n    Scenario: Aplicar Desconto de 20%\n\n        When aplico o seguinte cupom de desconto: \"MEUCAFE\"\n        Then o valor final da compra deve ser atualizado para \"R$ 25,99\"\n\n    Scenario Outline: Tentativa de aplicar o desconto\n        When aplico o seguinte cupom de desconto: \"<cupom>\"\n        Then devo ver a notificação: \"<saida>\"\n            And o valor final da compra deve permanecer o mesmo\n\n        Examples:\n            | cupom    | saida           |\n            | PROMO20  | Cupom expirado! |\n            | PROMO100 | Cupom inválido! |\n","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/pedido.feature","data":"Feature: Pedidos\n\n    Como um usuário do site Starbugs, eu quero selecionar e comprar cafés\n    Para que eu possa receber os produtor em meu endereço e efeturar o pagamento na entrega\n\n    @smoke\n    Scenario: Compra bem sucedida\n\n        Given que estou na página principal da Starbugs\n            And que iniciei a compra do item \"Expresso Tradicional\" \n        When faço a busca do seguinte CEP: \"04534011\"\n            And informo os demais dados do endereço:\n            | number  | 1000    |\n            | details | Apto 22 |\n            And escolho a forma de pagamento \"Cartão de Débito\"\n            And por fim finalizo a compra\n        Then sou redirecionado para a página de confirmação de pedido\n            And e deve ser informado o seguinte prazo de entrega: \"20 min - 30 min\"","mediaType":"text/x.cucumber.gherkin+plain"}},
